import React from 'react';
import Profile from './Profile';
import TechnicalResearch from './TechnicalResearch';

function Layout() {
  return (
    <div className="layout-container">
      <div className="layout-left">
        <Profile />
      </div>
      <div className="layout-right">
        <TechnicalResearch />
      </div>
    </div>
  );
}

export default Layout;
